import React from "react";

import logo from './assets/nexus.webp';
import Login from "./pages/Login";

function App() {
  return (
    <div className="App">
      <ToastContainer />
            <Routes>
                {/* Default route */}
                <Route path="/login" element={<Login />} />
            </Routes>
    </div>
  );
}

export default App;
